const Home=()=>{
const [sirovina,setSirovina]=useState(null);

useEffect(()=>{
const fetchSirovine=async()=>{
const response=await fetch('/api/sirovine')
const json=await response.json();

if(response.ok){
setSirovina(json);
}


}
fetchSirovine();
},[])



    return (
        <div className="home"> 
            <div className="sirovina">
                {sirovina &&sirovina.map((sirovin)=>(
                    <p key={sirovin._id}>{sirovin.naziv
                    }</p>
                ))}
            </div>
        </div>
    )
}

export default Home
